	(1783,1,'admin/weeks/1','PUT','127.0.0.1','{\"id\":\"1\",\"name\":\"Tu\\u1ea7n thi s\\u1ed1 1\",\"date_start\":\"2012-12-13 20:20:00\",\"date_end\":\"2019-12-14 00:00:00\",\"status\":\"1\",\"user_id_created\":\"1\",\"questions\":{\"1\":{\"title\":\"Deleting Data ?\",\"id\":\"1\",\"_remove_\":\"0\",\"answer\":{\"new_1\":{\"answer_id\":\"1\",\"checkbox\":\"correct\",\"content\":\"The forget method will remove a piece of data from the session. If you would like to remove all data from the session, you may use the flush method.\"},\"new_2\":{\"answer_id\":\"2\",\"content\":\"Regenerating the session ID is often done in order to prevent malicious users from exploiting a session fixation attack on your application.\"},\"new_3\":{\"answer_id\":\"3\",\"content\":\"Laravel automatically regenerates the session ID during authentication if you are using the built-in LoginController; however, if you need to manually regenerate the session ID, you may use the regenerate method\"}}},\"2\":{\"title\":\"Adding Custom Session Drivers ?\",\"id\":\"2\",\"_remove_\":\"0\",\"answer\":{\"new_1\":{\"answer_id\":\"4\",\"content\":\"Your custom session driver should implement the SessionHandlerInterface. This interface contains just a few simple methods we need to implement. A stubbed MongoDB implementation looks something like this\"},\"new_2\":{\"answer_id\":\"5\",\"checkbox\":\"correct\",\"content\":\"Laravel does not ship with a directory to contain your extensions. You are free to place them anywhere you like. In this example, we have created an Extensions directory to house the MongoSessionHandler.\"},\"new_3\":{\"answer_id\":\"6\",\"content\":\"Since the purpose of these methods is not readily understandable, let\'s quickly cover what each of the methods do\"}}},\"new_1\":{\"title\":\"Demo giao di\\u1ec7n\",\"id\":null,\"_remove_\":\"0\",\"answer\":{\"new_7\":{\"content\":\"\\u0110\\u00e1p \\u00e1n 1\"},\"new_8\":{\"content\":\"\\u0110\\u00e1p \\u00e1n 2\"},\"new_9\":{\"checkbox\":\